import { useQuery } from 'react-query'
import { useParams } from 'react-router-dom'
import GNB from 'routes/_shared/GNB'
import { getSearchListApi } from 'services/bookSearchApi'

const BookDetail = () => {
  const { paramValue } = useParams()
  // console.log(paramValue)

  const { data } = useQuery(['getSearchListApi'], () => getSearchListApi(paramValue).then((res) => res.data), {
    enabled: !!paramValue,
  })
  // console.log(data)
  return (
    <div>
      <GNB />
      {data ? (
        <div>
          <div>
            <img className='fit-picture' src={data.documents[0].thumbnail} alt={`${data.documents[0].title}_img`} />
          </div>
          <dl>
            <dt>{data.documents[0].title}</dt>
            <dd>{data.documents[0].authors}</dd>
            <dd>{data.documents[0].publisher}</dd>
          </dl>
        </div>
      ) : (
        <div>sdfds</div>
      )}
    </div>
  )
}

export default BookDetail
